import React, { useState } from "react";

const LogiqueModale = () => {
  const [isOpen, setIsOpen] = useState(false);

  function toggle() {
    setIsOpen(!isOpen);
  }

  return {
    isOpen,
    toggle,
  };
};

export default LogiqueModale;
